e same song part If you donâ€™t understand a lyric, use [?] To learn more, check out our transcription guide or visit our transcribers forum     About Genius Annotation 8 contributors According to Thom Yorke, â€œCreepâ€ tells the tale of an inebriated man who tries to get the attention of a woman to whom he is attracted by following her around. In the end, he lacks the self-confidence to face her and feels he subconsciously is her.  When asked about â€œCreepâ€ in 1993, Yorke said:  I have a real problem being a man in the â€˜90sâ€¦ Any man with any sensitivity or conscience toward the opposite sex would have a problem. To actually assert yourself in a masculine way without looking like youâ€™re in a hard-rock band is a very difficult thing to doâ€¦ It comes back to the music we write, which is not effeminate, but itâ€™s not brutal in its arrogance. It is one of the things Iâ€™m always trying: To assert a sexual persona and on the other hand trying desperately to negate it.  Jonny Greenwood said the song was in fact a happy song about â€œrecognizing what you areâ€.  Notable covers include those by The Pretenders , Carrie Manolakos , Macy Gray , Lea Michele and Dean Geyer , as part of Glee , Vega Choir , Prince , The Bluecoats Drum and Bugle Corps , and most recently, Kimberly Nichole , who performed a very strong cover of this song on the 2015 season of The Voice.  Despite, or perhaps because of, the popularity of the song, Radiohead grew to hate â€œCreepâ€ and have rarely played it live since the OK Computer tour. â€œMy Iron Lungâ€ , written in 1994 and later released on The Bends , is about the song. Expand      +444     6  4   Share    Q&A Find answers to frequently asked questions about the song and explore its deeper meaning Ask a question What did Radiohead say about "Creep"?  Genius Answer 2 contributors Thom Yorke said that the song is trying:  to assert a sexual persona and on the other hand trying desperately to negate it.  Explaining why itâ€™s rarely played at their live shows, Yorke said that:  It can be cool sometimes, but other times I want to stop halfway through and be like, â€˜Nah, this isnâ€™t happeningâ€™.  Who produced â€œCreepâ€ by Radiohead?  When did Radiohead release â€œCreepâ€?  Who wrote â€œCreepâ€ by Radiohead?     Pablo Honey (Collectors Edition)    (2009) Radiohead 1. You 2. Creep 3. How Do You? 4. Stop Whispering 5. Thinking About You 6. Anyone Can Play Guitar 7. Ripcord 8. Vegetable 9. Prove Yourself 10. I Canâ€™t 11. Lurgee 12. Blow Out 13. Prove Yourself (Drill Version) 14. Stupid Car 15. You (Drill Version) 16. Thinking About You (Drill Version) 17. Inside My Head 18. Million Dollar Question 19. Yes I Am 20. Blow Out (Remix) 21. Inside My Head (Live) 22. Creep (Acoustic) 23. Vegetable (Live)  (Missing Lyrics) 24. Killer Cars (Live) 25. Faithless the Wonderboy 26. Coke Babies 27. Pop Is Dead 28. Banana Co. (Acoustic)  (Missing Lyrics) 29. Ripcord (Live)  (Missing Lyrics) 30. Stop Whispering (U.S. Version)  (Missing Lyrics) 31. Prove Yourself (BBC Radio 1 Evening Session)  (Missing Lyrics) 32. Creep (BBC Radio 1 Evening Session) 33. I Canâ€™t (BBC Radio 1 Evening Session)  (Missing Lyrics) 34. Nothing Touches Me (BBC Radio 1 Evening Session) Expand      Credits Producer Chris Hufford Writers Thom Yorke , Jonny Greenwood , Ed Oâ€™Brien , Colin Greenwood , Philip Selway , Albert Hammond & Mike Hazlewood Mastering Engineer Paul Q. Kolderie & Sean Slade Mixing Engineer Chris Blair Phonographic Copyright â„— XL Recordings Copyright Â© XL Recordings Distributor Beggars Group Publisher Warner/Chappell Guitar Jonny Greenwood Vocals Thom Yorke & Ed Oâ€™Brien Rhythm Guitar Ed Oâ€™Brien Piano Jonny Greenwood Bass Colin Greenwood Drums Philip Selway Label Parlophone Records , Capitol Records & XL Recordings Recorded At Chipping Norton Recording Studios, Chipping Norton, Oxfordshire, England, United Kingdom Release Date September 21, 1992 Songs That Sample Creep Creep byÂ JohnÂ PollÃµn & Yung Nick , â€‹bet b