ls the tale of an inebriated man who tries to get the attention of a woman to whom he is attracted by following her around. In the end, he lacks the self-confidence to face her and feels he subconsciously is her.\\n\\nWhen asked about â€œCreepâ€ in 1993, Yorke said:\\n\\nI have a real problem being a man in the â€˜90sâ€¦ Any man with any sensitivity or conscience toward the opposite sex would have a problem. To actually assert yourself in a masculine way without looking like youâ€™re in a hard-rock band is a very difficult thing to doâ€¦ It comes back to the music we write, which is not effeminate, but itâ€™s not brutal in its arrogance. It is one of the things Iâ€™m always trying: To assert a sexual persona and on the other hand trying desperately to negate it.\\n\\nJonny Greenwood said the song was in fact a happy song about â€œrecognizing what you areâ€.\\n\\nNotable covers include those by The Pretenders, Carrie Manolakos, Macy Gray, Lea Michele and Dean Geyer, as part of Glee, Vega Choir, Prince, The Bluecoats Drum and Bugle Corps, and most recently, Kimberly Nichole, who performed a very strong cover of this song on the 2015 season of The Voice.\\n\\nDespite, or perhaps because of, the popularity of the song, Radiohead grew to hate â€œCreepâ€ and have rarely played it live since the OK Computer tour. â€œMy Iron Lungâ€, written in 1994 and later released on The Bends, is about the song.\",\"description\":{\"markdown\":\"According to Thom Yorke, \\\"Creep\\\" tells the tale of an inebriated man who tries to get the attention of a woman to whom he is attracted by following her around. In the end, he lacks the self-confidence to face her and feels he subconsciously is her. \\n\\nWhen asked about \\\"Creep\\\" in 1993, Yorke said:\\n>I have a real problem being a man in the \'90s... Any man with any sensitivity or conscience toward the opposite sex would have a problem. To actually assert yourself in a masculine way without looking like you\'re in a hard-rock band is a very difficult thing to do... It comes back to the music we write, which is not effeminate, but it\'s not brutal in its arrogance. It is one of the things I\'m always trying: To assert a sexual persona and on the other hand trying desperately to negate it.\\n\\nJonny Greenwood said the song was in fact a happy song about \\\"recognizing what you are\\\".\\n\\nNotable covers include those by [The Pretenders](https://www.youtube.com/watch?v=lML2N4xB9GU), [Carrie Manolakos](https://www.youtube.com/watch?v=aZ5ZclZTeTU\\n), [Macy Gray](www.youtube.com/watch?v=gwGYjLqI4GI), [Lea Michele and Dean Geyer](www.youtube.com/watch?v=ExB94HNrORs), as part of [*Glee*](https://genius.com/artists/Glee-cast), [Vega Choir](https://www.youtube.com/watch?v=oNqBsQiNoAU), [Prince](https://www.youtube.com/watch?v=NFXZNt4oLkE), [The Bluecoats Drum and Bugle Corps](https://www.youtube.com/watch?v=YyzzG5MTMyM), and most recently, [Kimberly Nichole](https://www.youtube.com/watch?v=butikHVPm5Q), who performed a very strong cover of this song on the 2015 season of *The Voice.*\\n\\nDespite, or perhaps because of, the popularity of the song, Radiohead grew to hate \\\"Creep\\\" and have rarely played it live since the OK Computer tour. [\\\"My Iron Lung\\\"](https://genius.com/Radiohead-my-iron-lung-lyrics), written in 1994 and later released on *The Bends*, is about the song.\",\"html\":\"<p>According to Thom Yorke, â€œCreepâ€ tells the tale of an inebriated man who tries to get the attention of a woman to whom he is attracted by following her around. In the end, he lacks the self-confidence to face her and feels he subconsciously is her.<\/p>\\n\\n<p>When asked about â€œCreepâ€ in 1993, Yorke said:<\/p>\\n\\n<blockquote><p>I have a real problem being a man in the â€˜90sâ€¦ Any man with any sensitivity or conscience toward the opposite sex would have a problem. To actually assert yourself in a masculine way without looking like youâ€™re in a hard-rock band is a very difficult thing to doâ€¦