74015748031496,\"type\":\"user_attribution\"},{\"user\":175962,\"pinnedRole\":null,\"attribution\":0.003937007874015748,\"type\":\"user_attribution\"}],\"acceptedBy\":116340,\"currentUserMetadata\":{\"iqByAction\":{},\"interactions\":{\"vote\":null,\"pyong\":false,\"cosign\":false},\"excludedPermissions\":[\"vote\",\"edit\",\"cosign\",\"uncosign\",\"destroy\",\"accept\",\"reject\",\"see_unreviewed\",\"clear_votes\",\"propose_edit_to\",\"pin_to_profile\",\"unpin_from_profile\",\"update_source\",\"edit_custom_preview\",\"create_comment\"],\"permissions\":[]},\"votesTotal\":444,\"verified\":false,\"url\":\"https://genius.com/3801258/Radiohead-creep/Creep\",\"twitterShareMessage\":\"â€œAccording to Thom Yorke, â€œCreepâ€ tells the tale of an inebriated man who tries to get the attention of aâ€¦â€ â€”@Genius\",\"state\":\"accepted\",\"source\":null,\"shareUrl\":\"https://genius.com/3801258\",\"referentId\":3801258,\"pyongsCount\":4,\"proposedEditCount\":0,\"pinned\":false,\"needsExegesis\":false,\"id\":3801258,\"hasVoters\":true,\"embedContent\":\"<blockquote class=\'rg_standalone_container\' data-src=\'//genius.com/annotations/3801258/standalone_embed\'><a href=\'https://genius.com/3801258/Radiohead-creep/Creep\'>Creep<\/a><br><a href=\'https://genius.com/Radiohead-creep-lyrics\'>&#8213; Radiohead â€“ Creep<\/a><\/blockquote><script async crossorigin src=\'//genius.com/annotations/load_standalone_embeds.js\'><\/script>\",\"deleted\":false,\"customPreview\":null,\"createdAt\":1361936060,\"community\":true,\"commentCount\":6,\"body\":{\"markdown\":\"According to Thom Yorke, \\\"Creep\\\" tells the tale of an inebriated man who tries to get the attention of a woman to whom he is attracted by following her around. In the end, he lacks the self-confidence to face her and feels he subconsciously is her. \\n\\nWhen asked about \\\"Creep\\\" in 1993, Yorke said:\\n>I have a real problem being a man in the \'90s... Any man with any sensitivity or conscience toward the opposite sex would have a problem. To actually assert yourself in a masculine way without looking like you\'re in a hard-rock band is a very difficult thing to do... It comes back to the music we write, which is not effeminate, but it\'s not brutal in its arrogance. It is one of the things I\'m always trying: To assert a sexual persona and on the other hand trying desperately to negate it.\\n\\nJonny Greenwood said the song was in fact a happy song about \\\"recognizing what you are\\\".\\n\\nNotable covers include those by [The Pretenders](https://www.youtube.com/watch?v=lML2N4xB9GU), [Carrie Manolakos](https://www.youtube.com/watch?v=aZ5ZclZTeTU\\n), [Macy Gray](www.youtube.com/watch?v=gwGYjLqI4GI), [Lea Michele and Dean Geyer](www.youtube.com/watch?v=ExB94HNrORs), as part of [*Glee*](https://genius.com/artists/Glee-cast), [Vega Choir](https://www.youtube.com/watch?v=oNqBsQiNoAU), [Prince](https://www.youtube.com/watch?v=NFXZNt4oLkE), [The Bluecoats Drum and Bugle Corps](https://www.youtube.com/watch?v=YyzzG5MTMyM), and most recently, [Kimberly Nichole](https://www.youtube.com/watch?v=butikHVPm5Q), who performed a very strong cover of this song on the 2015 season of *The Voice.*\\n\\nDespite, or perhaps because of, the popularity of the song, Radiohead grew to hate \\\"Creep\\\" and have rarely played it live since the OK Computer tour. [\\\"My Iron Lung\\\"](https://genius.com/Radiohead-my-iron-lung-lyrics), written in 1994 and later released on *The Bends*, is about the song.\",\"html\":\"<p>According to Thom Yorke, â€œCreepâ€ tells the tale of an inebriated man who tries to get the attention of a woman to whom he is attracted by following her around. In the end, he lacks the self-confidence to face her and feels he subconsciously is her.<\/p>\\n\\n<p>When asked about â€œCreepâ€ in 1993, Yorke said:<\/p>\\n\\n<blockquote><p>I have a real problem being a man in the â€˜90sâ€¦ Any man with any sensitivity or conscience toward the opposite sex would have a problem. To actually assert yourself in a masculine way without looking like youâ€™re in a hard-rock band is a very difficult thing to doâ€¦ It comes back to the music we write, which is not effeminate, but itâ€™s not brutal in its arrogance. It is one of the things Iâ€™m always trying: To assert a sexual persona and on the other hand trying desperately to negate it.<\/p><\/blockquote>\\n\\n<p>Jonny Greenwood said the song was in fact a happy song about â€œrecognizing what you areâ€.<\/p>\\n\\n<p>Notable covers include those by <a href=\\\"https://www.youtube.com/watch?v=lML2N4xB9GU\\\" rel=\\\"noopener nofollow\\\">The Pretenders<\/a>, <a href=\\\"https://www.youtube.com/watch?v=aZ5ZclZTeTU\\\" rel=\\\"noopener nofollow\\\">Carrie Manolakos<\/a>, <a href=\\\"http://www.youtube.com/watch?v=gwGYjLqI4GI\\\" rel=\\\"noopener nofollow\\\">Macy Gray<\/a>, <a href=\\\"http://www.youtube.com/watch?v=ExB94HNrORs\\\" rel=\\\"noopener nofollow\\\">Lea Michele and Dean Geyer<\/a>, as part of <a href=\\\"https://genius.com/artists/Glee-cast\\\" rel=\\\"noopener\\\" data-api_path=\\\"/artists/275474\\\"><em>Glee<\/em><\/a>, <a href=\\\"https://www.youtube.com/watch?v=oNqBsQiNoAU\\\" rel=\\\"noopener nofollow\\\">Vega Choir<\/a>, <a href=\\\"https://www.youtube.com/watch?v=NFXZNt4oLkE\\\" rel=\\\"noopener nofollow\\\">Prince<\/a>, <a href=\\\"https://www.youtube.com/watch?v=YyzzG5MTMyM\\\" rel=\\\"noopener nofollow\\\">The Bluecoats Drum and Bugle Corps<\/a>, and most recently, <a href=\\\"https://www.youtube.com/watch?v=butikHVPm5Q\\\" rel=\\\"noopener nofollow\\\">Kimberly Nichole<\/a>, who performed a very strong cover of this song on the 2015 season of <em>The Voice.<\/em><\/p>\\n\\n<p>Despite, or perhaps because of, the popularity of the song, Radiohead grew to hate â€œCreepâ€ and have rarely played it live since the OK Computer tour. <a href=\\\"https://genius.com/Radiohead-my-iron-lung-lyrics\\\" rel=\\\"noopener\\\" data-api_path=\\\"/songs/71499\\\">â€œMy Iron Lungâ€<\/a>, written in 1994 